import React from 'react'

const GetInTouch = () => {
  return (
    <div className='max-w-5xl mx-auto mt-16'>
        <h1 className='text-3xl font-palanquin font-semibold inline-block'><span className='text-blue-600'>What</span> are you <span className='text-blue-600'>waiting</span> for?</h1>
        <button className='w-full px-2 font-semibold py-[1px] text-blue-600 border-blue-600 border-[2px] rounded-xl hover:text-white hover:bg-blue-600 transition-colors'>
          Get in touch!
        </button>
    </div>
  )
}

export default GetInTouch
